document.addEventListener('DOMContentLoaded', () => {
    console.log('=== Admin Panel Orders Page Loaded ===');
    console.log('Initializing orders page...');
    let filteredOrders = [];

    // Check if jsPDF and autoTable are loaded early
    let jsPDF, autoTable;
    if (typeof window.jspdf === 'undefined' || typeof window.jspdf.jsPDF === 'undefined') {
        console.error("jsPDF library is not loaded. Make sure to include it in your HTML.");
    } else {
        jsPDF = window.jspdf.jsPDF; // Assign constructor
    }
    if (typeof jsPDF !== 'undefined' && typeof jsPDF.API?.autoTable === 'undefined') {
        console.error("jsPDF-AutoTable plugin is not loaded. Make sure to include it after jsPDF in your HTML.");
    } else if (typeof jsPDF !== 'undefined') {
        autoTable = jsPDF.API.autoTable; // Assign autoTable function
    }

    if (typeof jsPDF === 'undefined' || typeof autoTable === 'undefined') {
        // Disable button if either library is missing
        const printBtn = document.getElementById('modalPrintBtn');
        if (printBtn) {
            printBtn.disabled = true;
            printBtn.title = "PDF generation library not loaded correctly.";
            printBtn.style.opacity = 0.5;
            printBtn.style.cursor = 'not-allowed';
        }
    }
    // ✅ Download Orders as Excel (.xlsx) with only filtered data
    document.getElementById("downloadOrdersBtn")?.addEventListener("click", () => {
        // Get filtered data
        const ordersToDownload = window.filteredOrders?.length
            ? window.filteredOrders
            : (window.filteredOrders && window.filteredOrders.length === 0)
                ? []
                : ordersData;

        // ✅ Excel Header
        const header = ["Order ID", "Customer", "Total Amount", "Payment Status", "Order Status", "Date"];
        const rows = [header];

        // ✅ If no orders, download empty sheet with only header
        if (!ordersToDownload || ordersToDownload.length === 0) {
            exportToExcel(rows, "filtered_orders.xlsx");
            showAlert("No records found — empty Excel generated.", 'info');
            return;
        }

        // ✅ Push filtered rows
        ordersToDownload.forEach(order => {
            rows.push([
                order.id || "",
                order.customer?.name || "",
                order.payment?.total || "",
                order.payment?.status || "",
                order.orderStatus || "",
                order.date || "",
            ]);
        });

        exportToExcel(rows, "filtered_orders.xlsx");
    });

    function exportToExcel(data, filename = "orders.xlsx") {
        // Convert 2D array to worksheet
        const ws = XLSX.utils.aoa_to_sheet(data);

        // Create workbook & add sheet
        const wb = XLSX.utils.book_new();
        XLSX.utils.book_append_sheet(wb, ws, "Orders");

        // Trigger download
        XLSX.writeFile(wb, filename);
    }



    // Base currency = INR
    const EXCHANGE_RATES = {
        us: { rate: 1.0, symbol: "USD $" },
        ca: { rate: 1.38, symbol: "CAD $" }
    };


    function getSelectedRegion() {
        try {
            return localStorage.getItem("he_she_selected_region") || "us";
        } catch {
            return "us";
        }
    }

    function formatPrice(amountUSD) {
        const region = (getSelectedRegion() || "us").toLowerCase();
        const exchange = EXCHANGE_RATES[region] || EXCHANGE_RATES.us;

        const converted = Number(amountUSD || 0) * exchange.rate;
        return `${exchange.symbol}${converted.toFixed(2)}`;
    }



    function formatStatusChangeDate(dateStr) {
        if (!dateStr || dateStr === 'null') return '<span style="color: #999;">Not Updated</span>';
        try {
            const date = new Date(dateStr);
            if (isNaN(date.getTime())) return '<span style="color: #999;">Not Updated</span>';
            return date.toLocaleString('en-IN', {
                timeZone: 'Asia/Kolkata',
                day: '2-digit',
                month: 'short',
                year: 'numeric',
                hour: '2-digit',
                minute: '2-digit',
                hour12: true
            });
        } catch (e) {
            return '<span style="color: #999;">Not Updated</span>';
        }
    }


    // --- Helper function to get CSRF token ---
    function getCookie(name) {
        let cookieValue = null;
        if (document.cookie && document.cookie !== '') {
            const cookies = document.cookie.split(';');
            for (let i = 0; i < cookies.length; i++) {
                const cookie = cookies[i].trim();
                if (cookie.substring(0, name.length + 1) === (name + '=')) {
                    cookieValue = decodeURIComponent(cookie.substring(name.length + 1));
                    break;
                }
            }
        }
        return cookieValue;
    }

    // --- Load Orders from Django API ---
    let ordersData = []; // Will be populated from API

    async function loadOrdersFromAPI() {
        console.log('=== Loading Orders from API ===');
        console.log('API Endpoint: /admin/api/orders/');
        try {
            const response = await fetch(`/admin/api/orders/?t=${new Date().getTime()}`);
            console.log('Orders API Response Status:', response.status);
            console.log('Orders API Response OK:', response.ok);

            if (response.ok) {
                const data = await response.json();
                console.log('Orders API Response Data:', data);
                console.log('Number of orders in response:', data.orders ? data.orders.length : 0);

                if (data.orders && data.orders.length > 0) {
                    // Convert API format to expected format
                    ordersData = data.orders.map(order => {
                        const dateObj = new Date(order.dateObj || order.created_at || new Date());
                        const items = order.items.map(item => ({
                            sku: item.sku || item.product_id || 'N/A',
                            name: item.name || item.product_name || 'Unknown Product',
                            qty: item.qty || item.quantity || 1,
                            price: parseFloat(item.price || 0),

                        }));

                        return {
                            id: order.id || order.order_number || `#${order.order_id || 'N/A'}`,
                            dbOrderId: order.order_id || null, // Store database ID for updates
                            customer: {
                                name: order.customer?.name || order.customer_name || 'Guest Customer',
                                email: order.customer?.email || order.customer_email || 'N/A',
                                phone: order.customer?.phone || order.customer_phone || 'N/A',
                                shippingAddress: order.customer?.shippingAddress || `${order.shipping_address || ''}\n${order.shipping_city || ''}, ${order.shipping_state || ''} ${order.shipping_pincode || ''}`,
                                billingAddress: order.customer?.billingAddress || `${order.shipping_address || ''}\n${order.shipping_city || ''}, ${order.shipping_state || ''} ${order.shipping_pincode || ''}`
                            },
                            dateObj: dateObj,
                            date: order.date || dateObj.toLocaleString('en-US', { month: 'short', day: 'numeric', year: 'numeric', hour: 'numeric', minute: '2-digit' }),
                            statusChangeDate: order.status_change_date || null,
                            items: items,
                            payment: {
                                method: order.payment?.method || order.payment_method || 'N/A',
                                status: order.payment?.status || (order.payment_status ? 'paid' : 'pending'),
                                subtotal: parseFloat(order.payment?.subtotal || order.total_amount || 0),
                                discount: parseFloat(order.payment?.discount || 0),
                                tax: parseFloat(order.payment?.tax || 0),
                                shipping: parseFloat(order.payment?.shipping || 0),
                                total: parseFloat(order.payment?.total || order.total_amount || 0),
                                transactionId: order.payment?.transactionId || order.transaction_id || null
                            },
                            orderStatus: order.orderStatus || order.status || 'pending',
                            delivery: {
                                partner: order.delivery?.partner || order.courier_name || order.delivery_partner || 'N/A',
                                tracking: order.delivery?.tracking || order.tracking_code || order.tracking_number || 'N/A',
                                estDate: order.delivery?.estDate || order.delivery_date || 'N/A'
                            }

                        };
                    });

                    console.log('Orders loaded from API:', ordersData.length);
                    console.log('Orders data:', ordersData);
                    // Render orders after loading
                    filterAndRenderOrders();
                } else {
                    console.warn('No orders found in API response');
                    ordersData = [];
                    filterAndRenderOrders();
                }
            } else {
                console.error('Failed to fetch orders from API. Status:', response.status);
                const errorText = await response.text();
                console.error('Error response:', errorText);
                ordersData = [];
                filterAndRenderOrders();
            }
        } catch (error) {
            console.error('Error loading orders from API:', error);
            console.error('Error stack:', error.stack);
            ordersData = [];
            filterAndRenderOrders();
        }
        console.log('=== Finished Loading Orders ===');
    }

    // --- OLD DUMMY ORDER DATA (commented out, keeping for reference) ---
    // This section is commented out - old dummy data no longer needed
    // Orders are now loaded from Django API via loadOrdersFromAPI()

    // --- DOM Elements ---
    const tableBody = document.getElementById('orders-table-body');
    const searchInput = document.getElementById('orderSearch');
    const dateFromInput = document.getElementById('dateFrom');
    const dateToInput = document.getElementById('dateTo');
    const orderStatusFilter = document.getElementById('orderStatusFilter');
    const paymentStatusFilter = document.getElementById('paymentStatusFilter');

    let orderStatusChoiceInstance = null;
    let paymentStatusChoiceInstance = null;
    let modalStatusChoiceInstance = null;
    let currentOrderId = null; // For View/Update modal
    let orderIdToCancel = null; // For Cancel modal

    // --- Cancel Modal Elements ---
    const cancelModal = document.getElementById('cancelConfirmModal');
    const confirmCancelBtn = document.getElementById('confirmCancelBtn');
    const cancelActionBtn = document.getElementById('cancelActionBtn'); // "Keep Order" button
    const cancelModalCloseBtn = document.getElementById('cancelModalCloseBtn');
    const cancelOrderIdSpan = document.getElementById('cancelOrderId');

    const openCancelModal = (orderId) => {
        orderIdToCancel = orderId;
        if (cancelOrderIdSpan) cancelOrderIdSpan.textContent = orderId;
        if (cancelModal) cancelModal.classList.add('show');
    };
    const closeCancelModal = () => {
        if (cancelModal) cancelModal.classList.remove('show');
        orderIdToCancel = null;
    };
    // --- END: Cancel Modal Elements ---


    const getStatusSpan = (status, type) => {
        let statusClass = status ? status.toLowerCase() : 'unknown'; // Added default
        let statusText = status ? status.charAt(0).toUpperCase() + status.slice(1) : 'Unknown';
        return `<span class="status ${statusClass}">${statusText}</span>`;
    };


    // --- Render Orders Function ---
    const renderOrders = (ordersToRender) => {
        if (!tableBody) return;
        tableBody.innerHTML = '';

        if (ordersToRender.length === 0) {
            const row = document.createElement('tr');
            row.innerHTML = `<td colspan="8" style="text-align: center; color: var(--text-secondary);">No orders found matching your criteria.</td>`;
            tableBody.appendChild(row);
            return;
        }

        ordersToRender.forEach(order => {
            // Basic safety check for items array
            const firstItemName = (order.items && order.items.length > 0 && order.items[0].name) ? order.items[0].name : 'Item N/A';
            const itemsSummary = (order.items && order.items.length > 1)
                ? `${firstItemName} + ${order.items.length - 1} more`
                : firstItemName;


            const isCancellable = order.orderStatus === 'processing' || order.orderStatus === 'pending'; // Adjust conditions as needed
            const cancelBtnClass = isCancellable ? 'btn-cancel' : 'btn-cancel disabled';
            const cancelBtnHref = isCancellable ? '#' : ''; // Remove href if disabled
            const cancelBtnTitle = isCancellable ? 'Cancel Order' : 'Cannot cancel this order';

            const newRow = document.createElement('tr');
            newRow.innerHTML = `
                <td><a href="/admin/order/${order.dbOrderId}/" style="color: #2563eb; text-decoration: none; font-weight: 500;">${order.id || 'N/A'}</a></td>
                <td>${order.customer?.name || 'N/A'}</td>
                <td>${order.date?.split(',')[0] || 'N/A'}</td>
                <td>${itemsSummary}</td>
                <td>${formatPrice(order.payment?.total || 0)}</td>


                <td>${getStatusSpan(order.payment?.status, 'payment')}</td>
                <td>
                    <select class="status-select ${order.orderStatus ? order.orderStatus.toLowerCase() : 'pending'}" data-order-id="${order.id}">
                        <option value="pending" ${order.orderStatus === 'pending' ? 'selected' : ''}>Pending</option>
                        <option value="shipping" ${order.orderStatus === 'shipping' ? 'selected' : ''}>Shipping</option>
                        <option value="shipped" ${order.orderStatus === 'shipped' ? 'selected' : ''}>Shipped</option>
                        <option value="delivered" ${order.orderStatus === 'delivered' ? 'selected' : ''}>Delivered</option>
                        <option value="return_requested" ${order.orderStatus === 'return_requested' ? 'selected' : ''}>Return Requested</option>
                        <option value="returned" ${order.orderStatus === 'returned' ? 'selected' : ''}>Returned</option>
                        <option value="fulfilled" ${order.orderStatus === 'fulfilled' ? 'selected' : ''}>Order Fulfilled</option>
                        <option value="cancelled" ${order.orderStatus === 'cancelled' ? 'selected' : ''}>Cancelled</option>
                    </select>
                </td>
                <td>${formatStatusChangeDate(order.statusChangeDate)}</td>
                <td>
                    <div class="action-buttons">
                        <a href="/admin/order/${order.dbOrderId}/" class="btn-action btn-view" title="View Details">
                            <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><path d="M1 12s4-8 11-8 11 8 11 8-4 8-11 8-11-8-11-8z"></path><circle cx="12" cy="12" r="3"></circle></svg>
                        </a>
                        <a href="${cancelBtnHref}" class="btn-action ${cancelBtnClass}" data-order-id="${order.id}" title="${cancelBtnTitle}">
                            <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"><circle cx="12" cy="12" r="10"></circle><line x1="15" y1="9" x2="9" y2="15"></line><line x1="9" y1="9" x2="15" y2="15"></line></svg>
                        </a>
                    </div>
                </td>
            `;
            tableBody.appendChild(newRow);
        });
    };

    // --- Tracking Modal Logic ---
    const trackingModal = document.getElementById('trackingInputModal');
    const trackingModalCloseBtn = document.getElementById('trackingModalCloseBtn');
    const cancelTrackingBtn = document.getElementById('cancelTrackingBtn');
    const confirmTrackingBtn = document.getElementById('confirmTrackingBtn');
    const trackingInput = document.getElementById('modalInputTrackingCode');
    const courierInput = document.getElementById('modalInputCourierName');
    const trackingError = document.getElementById('trackingInputError');
    const trackingOrderIdDisplay = document.getElementById('trackingOrderIdDisplay');

    let pendingShipmentParams = null; // Store { orderId, dbOrderId, selectElement, oldStatus }

    const openTrackingModal = (orderId, orderIdentifier) => {
        if (trackingOrderIdDisplay) trackingOrderIdDisplay.textContent = `Order ${orderIdentifier}`;
        if (trackingInput) {
            trackingInput.value = ''; // Reset input
        }
        if (courierInput) {
            courierInput.value = ''; // Reset courier input
            courierInput.focus();
        } else if (trackingInput) {
            trackingInput.focus();
        }
        if (trackingError) trackingError.style.display = 'none';
        if (trackingModal) trackingModal.classList.add('show');
    };

    const closeTrackingModal = () => {
        if (trackingModal) trackingModal.classList.remove('show');
        // Reset params
        if (pendingShipmentParams) {
            // Check if we need to revert? Logic handled in cancel action
        }
        // pendingShipmentParams = null; // Don't clear immediately, let cancel handler do it
    };

    // Modal Actions
    const handleTrackingCancel = () => {
        if (pendingShipmentParams && pendingShipmentParams.selectElement) {
            // Revert dropdown
            pendingShipmentParams.selectElement.value = pendingShipmentParams.oldStatus;
        }
        closeTrackingModal();
        pendingShipmentParams = null;
    };

    if (trackingModalCloseBtn) trackingModalCloseBtn.addEventListener('click', handleTrackingCancel);
    if (cancelTrackingBtn) cancelTrackingBtn.addEventListener('click', handleTrackingCancel);

    // Close on click outside
    window.addEventListener('click', (e) => {
        if (e.target === trackingModal) handleTrackingCancel();
    });

    if (confirmTrackingBtn) {
        confirmTrackingBtn.addEventListener('click', async () => {
            if (!pendingShipmentParams) return;

            const code = trackingInput.value.trim();
            const courier = courierInput ? courierInput.value.trim() : '';

            if (!code || !courier) {
                if (trackingError) {
                    trackingError.textContent = "Both Courier Name and Tracking code are required.";
                    trackingError.style.display = 'block';
                }
                return;
            }

            // Prepare for API call
            const { dbOrderId, selectElement, orderData } = pendingShipmentParams;
            const newStatus = 'shipped';

            // Show loading state
            const originalBtnText = confirmTrackingBtn.textContent;
            confirmTrackingBtn.disabled = true;
            confirmTrackingBtn.textContent = "Processing...";

            try {
                const response = await fetch('/admin/api/orders/update/', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                        'X-CSRFToken': getCookie('csrftoken')
                    },
                    body: JSON.stringify({
                        order_id: dbOrderId,
                        status: newStatus,
                        tracking_code: code,
                        courier_name: courier
                    })
                });

                const result = await response.json();

                if (response.ok && result.success) {
                    // Update local data
                    orderData.orderStatus = newStatus;
                    orderData.status = newStatus;

                    if (result.order) {
                        if (!orderData.delivery) orderData.delivery = {};
                        if (result.order.tracking_code) orderData.delivery.tracking = result.order.tracking_code;
                        if (result.order.courier_name) orderData.delivery.partner = result.order.courier_name;
                    }

                    // Update UI classes for the select element
                    selectElement.className = `status-select ${newStatus}`;

                    // Close modal and clear params
                    closeTrackingModal();
                    pendingShipmentParams = null;

                    // Optional: Refresh data in background?
                    // await loadOrdersFromAPI(); 
                } else {
                    if (trackingError) {
                        trackingError.textContent = result.message || "Failed to update order.";
                        trackingError.style.display = 'block';
                    }
                    // Revert is not needed here as we stay in modal to retry
                }
            } catch (error) {
                console.error('API Error:', error);
                if (trackingError) {
                    trackingError.textContent = "Network error. Please try again.";
                    trackingError.style.display = 'block';
                }
            } finally {
                confirmTrackingBtn.disabled = false;
                confirmTrackingBtn.textContent = originalBtnText;
            }
        });
    }


    // --- Return Package Modal Logic ---
    const returnModal = document.getElementById('returnPackageModal');
    const returnModalCloseBtn = document.getElementById('returnModalCloseBtn');
    const cancelReturnBtn = document.getElementById('cancelReturnBtn');
    const confirmReturnBtn = document.getElementById('confirmReturnBtn');
    const returnInput = document.getElementById('modalReturnPackageNumber');
    const returnError = document.getElementById('returnInputError');
    const returnOrderIdDisplay = document.getElementById('returnOrderIdDisplay');

    let pendingReturnParams = null;

    const openReturnModal = (orderId, orderIdentifier, params) => {
        if (returnOrderIdDisplay) returnOrderIdDisplay.textContent = `Order ${orderIdentifier}`;
        if (returnInput) {
            returnInput.value = '';
            returnInput.focus();
        }
        if (returnError) returnError.style.display = 'none';

        pendingReturnParams = params;
        if (returnModal) returnModal.classList.add('show');
    };

    const closeReturnModal = () => {
        if (returnModal) returnModal.classList.remove('show');
    };

    const handleReturnCancel = () => {
        if (pendingReturnParams) {
            if (pendingReturnParams.source === 'table' && pendingReturnParams.selectElement) {
                pendingReturnParams.selectElement.value = pendingReturnParams.oldStatus;
            } else if (pendingReturnParams.source === 'modal' && modalStatusChoiceInstance) {
                modalStatusChoiceInstance.setChoiceByValue(pendingReturnParams.oldStatus);
            } else if (pendingReturnParams.source === 'modal' && modalUpdateStatusSelect) {
                modalUpdateStatusSelect.value = pendingReturnParams.oldStatus;
            }
        }
        closeReturnModal();
        pendingReturnParams = null;
    };

    if (returnModalCloseBtn) returnModalCloseBtn.addEventListener('click', handleReturnCancel);
    if (cancelReturnBtn) cancelReturnBtn.addEventListener('click', handleReturnCancel);

    window.addEventListener('click', (e) => {
        if (e.target === returnModal) handleReturnCancel();
    });

    if (confirmReturnBtn) {
        confirmReturnBtn.addEventListener('click', async () => {
            if (!pendingReturnParams) return;

            const code = returnInput.value.trim();
            if (!code) {
                if (returnError) {
                    returnError.style.display = 'block';
                }
                return;
            }

            const { dbOrderId, selectElement, orderData, source } = pendingReturnParams;
            const newStatus = 'returned';

            const originalBtnText = confirmReturnBtn.textContent;
            confirmReturnBtn.disabled = true;
            confirmReturnBtn.textContent = "Processing...";

            try {
                const response = await fetch('/admin/api/orders/update/', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                        'X-CSRFToken': getCookie('csrftoken')
                    },
                    body: JSON.stringify({
                        order_id: dbOrderId,
                        status: newStatus,
                        return_package_number: code
                    })
                });

                const result = await response.json();

                if (response.ok && result.success) {
                    orderData.orderStatus = newStatus;
                    orderData.status = newStatus;
                    orderData.return_package_number = code;

                    if (source === 'table' && selectElement) {
                        selectElement.className = `status-select ${newStatus}`;
                        selectElement.value = newStatus;
                    } else if (source === 'modal') {
                        if (modalStatusChoiceInstance) {
                            modalStatusChoiceInstance.setChoiceByValue(newStatus);
                        }
                    }

                    closeReturnModal();
                    pendingReturnParams = null;
                    // showAlert("Order returned successfully", 'success');
                } else {
                    if (returnError) {
                        returnError.textContent = result.message || "Failed to update.";
                        returnError.style.display = 'block';
                    }
                }
            } catch (error) {
                console.error('API Error:', error);
                if (returnError) {
                    returnError.textContent = "Network error.";
                    returnError.style.display = 'block';
                }
            } finally {
                confirmReturnBtn.disabled = false;
                confirmReturnBtn.textContent = originalBtnText;
            }
        });
    }


    // --- Table Change Listener (for Dropdowns) ---
    if (tableBody) {
        tableBody.addEventListener('change', async (e) => {
            if (e.target.classList.contains('status-select')) {
                const selectEl = e.target;
                const newStatus = selectEl.value;
                const visualOrderId = selectEl.dataset.orderId;
                const orderData = ordersData.find(o => o.id === visualOrderId);

                if (!orderData) {
                    showAlert("Error: Order data not found locally.", 'error');
                    return;
                }

                const orderIdToUpdate = orderData.dbOrderId || orderData.id;
                const oldStatus = orderData.orderStatus || 'pending';

                // --- STRICT FLOW ENFORCEMENT ---
                // Only allow "Fulfilled" if currently "Delivered"
                if (newStatus === 'fulfilled' && oldStatus !== 'delivered') {
                    showAlert('⚠️ Order can only be marked as "Fulfilled" after it is "Delivered".', 'warning');
                    selectEl.value = oldStatus;
                    return;
                }

                // Intercept 'shipped' status
                if (newStatus === 'shipped') {
                    // Open Modal
                    pendingShipmentParams = {
                        orderId: visualOrderId,
                        dbOrderId: orderIdToUpdate,
                        selectElement: selectEl,
                        oldStatus: oldStatus,
                        orderData: orderData
                    };

                    // Pre-fill if exists
                    if (trackingInput && orderData.delivery?.tracking && orderData.delivery.tracking !== 'N/A') {
                        trackingInput.value = orderData.delivery.tracking;
                    }

                    openTrackingModal(orderIdToUpdate, visualOrderId);
                    return; // Stop here, wait for modal interaction
                }

                // Intercept 'returned' status
                if (newStatus === 'returned') {
                    pendingReturnParams = {
                        source: 'table',
                        orderId: visualOrderId,
                        dbOrderId: orderIdToUpdate,
                        selectElement: selectEl,
                        oldStatus: oldStatus,
                        orderData: orderData
                    };
                    openReturnModal(orderIdToUpdate, visualOrderId, pendingReturnParams);
                    return;
                }

                // Normal update for other statuses (pending, shipping)
                const originalColor = selectEl.style.backgroundColor;
                selectEl.disabled = true;
                selectEl.style.opacity = '0.7';

                try {
                    const response = await fetch('/admin/api/orders/update/', {
                        method: 'POST',
                        headers: {
                            'Content-Type': 'application/json',
                            'X-CSRFToken': getCookie('csrftoken')
                        },
                        body: JSON.stringify({
                            order_id: orderIdToUpdate,
                            status: newStatus,
                            tracking_code: '' // Not required for non-shipped (pending, shipping, delivered, cancelled)
                        })
                    });

                    const result = await response.json();

                    if (response.ok && result.success) {
                        orderData.orderStatus = newStatus;
                        selectEl.className = `status-select ${newStatus}`;
                    } else {
                        showAlert(`Failed to update: ${result.message || 'Unknown error'}`, 'error');
                        selectEl.value = oldStatus; // Revert
                    }
                } catch (error) {
                    console.error('API Error:', error);
                    showAlert("Network error occurred.", 'error');
                    selectEl.value = oldStatus; // Revert
                } finally {
                    selectEl.disabled = false;
                    selectEl.style.opacity = '1';
                }
            }
        });
    }

    // --- Filter and Render Logic ---
    const filterAndRenderOrders = () => {
        const searchTerm = searchInput.value.toLowerCase();
        // Ensure flatpickr instance exists before accessing selectedDates
        const dateFromSelected = dateFromInput._flatpickr ? dateFromInput._flatpickr.selectedDates[0] : null;
        const dateToSelected = dateToInput._flatpickr ? dateToInput._flatpickr.selectedDates[0] : null;

        const orderStatus = orderStatusChoiceInstance ? orderStatusChoiceInstance.getValue(true) : '';
        const paymentStatus = paymentStatusChoiceInstance ? paymentStatusChoiceInstance.getValue(true) : '';

        const dateFrom = dateFromSelected ? new Date(dateFromSelected) : null;
        const dateTo = dateToSelected ? new Date(dateToSelected) : null;

        if (dateTo) { dateTo.setHours(23, 59, 59, 999); } // Include end date
        if (dateFrom) { dateFrom.setHours(0, 0, 0, 0); } // Start from beginning of day

        const filteredOrders = ordersData.filter(order => {
            // Add checks for potentially missing data
            const orderIdMatch = order.id?.toLowerCase().includes(searchTerm);
            const customerNameMatch = order.customer?.name?.toLowerCase().includes(searchTerm);
            const matchesSearch = searchTerm === '' || orderIdMatch || customerNameMatch;

            const matchesDate = (!dateFrom || (order.dateObj && order.dateObj >= dateFrom)) &&
                (!dateTo || (order.dateObj && order.dateObj <= dateTo));

            const matchesOrderStatus = !orderStatus || order.orderStatus === orderStatus;
            const matchesPaymentStatus = !paymentStatus || order.payment?.status === paymentStatus;

            return matchesSearch && matchesDate && matchesOrderStatus && matchesPaymentStatus;
        });
        // ✅ Save current filtered data globally for CSV download
        window.filteredOrders = filteredOrders;

        renderOrders(filteredOrders);
    };

    // --- View Order Modal Logic ---
    const modal = document.getElementById('orderDetailsModal');
    const closeBtn = document.getElementById('orderModalCloseBtn');
    const modalOrderId = document.getElementById('modalOrderId');
    const modalCustomerName = document.getElementById('modalCustomerName');
    const modalCustomerEmail = document.getElementById('modalCustomerEmail');
    const modalCustomerPhone = document.getElementById('modalCustomerPhone');
    const modalShippingAddress = document.getElementById('modalShippingAddress');
    const modalBillingAddress = document.getElementById('modalBillingAddress');
    const modalPaySubtotal = document.getElementById('modalPaySubtotal');
    const modalPayDiscount = document.getElementById('modalPayDiscount');
    const modalPayTax = document.getElementById('modalPayTax');
    const modalPayShipping = document.getElementById('modalPayShipping');
    const modalPayTotal = document.getElementById('modalPayTotal');
    const modalPayMethod = document.getElementById('modalPayMethod');
    const modalPayTransId = document.getElementById('modalPayTransId');
    const modalDeliveryPartner = document.getElementById('modalDeliveryPartner');
    const modalDeliveryTracking = document.getElementById('modalDeliveryTracking');
    const modalDeliveryEst = document.getElementById('modalDeliveryEst');
    const modalItemsTableBody = document.getElementById('modalItemsTableBody');
    const modalUpdateStatusSelect = document.getElementById('modalUpdateStatus');
    const modalUpdateBtn = document.getElementById('modalUpdateBtn');
    const modalPrintBtn = document.getElementById('modalPrintBtn');

    const openOrderModal = (orderId) => {
        currentOrderId = orderId;
        const order = ordersData.find(o => o.id === orderId);
        if (!order) {
            console.error(`Order with ID ${orderId} not found.`);
            return;
        }

        modalOrderId.textContent = `Order Details ${order.id || 'N/A'}`;
        // Use optional chaining for safety
        modalCustomerName.textContent = order.customer?.name || 'N/A';
        modalCustomerEmail.textContent = order.customer?.email || 'N/A';
        modalCustomerPhone.textContent = order.customer?.phone || 'N/A';
        // Display address with line breaks
        modalShippingAddress.innerHTML = (order.customer?.shippingAddress || 'N/A').replace(/\n/g, '<br>');
        modalBillingAddress.innerHTML = (order.customer?.billingAddress || 'N/A').replace(/\n/g, '<br>');

        modalPaySubtotal.textContent = formatPrice(order.payment?.subtotal || 0);
        modalPayDiscount.textContent = `-${formatPrice(order.payment?.discount || 0)}`;
        modalPayTax.textContent = formatPrice(order.payment?.tax || 0);
        modalPayShipping.textContent = formatPrice(order.payment?.shipping || 0);
        modalPayTotal.textContent = formatPrice(order.payment?.total || 0);


        modalDeliveryPartner.textContent = order.delivery?.partner || 'N/A';
        modalDeliveryTracking.textContent = order.delivery?.tracking || 'N/A';
        modalDeliveryEst.textContent = order.delivery?.estDate || 'N/A';

        modalItemsTableBody.innerHTML = '';
        if (order.items && order.items.length > 0) {
            order.items.forEach(item => {
                const row = document.createElement('tr');
                const itemPrice = item.price || 0;
                const itemQty = item.qty || 0;
                row.innerHTML = `
                    <td>${item.name || 'N/A'}</td>
                    <td>${item.sku || 'N/A'}</td>
                    <td>${itemQty}</td>
                    <td>${formatPrice(itemPrice)}</td>
                    <td>${formatPrice(itemQty * itemPrice)}</td>`;
                modalItemsTableBody.appendChild(row);
            });
        } else {
            modalItemsTableBody.innerHTML = `<tr><td colspan="5" style="text-align: center;">No items found for this order.</td></tr>`;
        }


        if (modalStatusChoiceInstance) {
            modalStatusChoiceInstance.setChoiceByValue(order.orderStatus || 'pending');
        } else if (modalUpdateStatusSelect) {
            modalUpdateStatusSelect.value = order.orderStatus || 'pending';
        }

        // Show/Hide tracking code input based on status
        const trackingGroup = document.getElementById('trackingCodeGroup');
        const trackingInput = document.getElementById('modalTrackingCode');
        const currentStatus = order.orderStatus || 'pending';

        if (trackingGroup) {
            if (currentStatus === 'shipped') {
                trackingGroup.style.display = 'flex'; // or block/flex depending on layout
                // Pre-fill if available
                if (trackingInput) {
                    trackingInput.value = (order.delivery && order.delivery.tracking !== 'N/A') ? order.delivery.tracking : '';
                }
            } else {
                trackingGroup.style.display = 'none';
                if (trackingInput) trackingInput.value = '';
            }
        }

        if (modal) modal.classList.add('show');
    };

    const closeOrderModal = () => {
        if (modal) modal.classList.remove('show');
        currentOrderId = null;
    };
    // ... (rest of the functions like filterAndRenderOrders, renderOrders, cancel logic, initializations)


    // --- Table Click Listener ---
    if (tableBody) {
        tableBody.addEventListener('click', (e) => {
            const viewButton = e.target.closest('.btn-view');
            const cancelButton = e.target.closest('.btn-cancel');

            // View button logic removed to allow default navigation (href redirect)
            // if (viewButton) { ... }


            if (cancelButton) {
                e.preventDefault();
                const orderId = cancelButton.dataset.orderId;
                if (!orderId) {
                    console.error("Cancel button clicked but no order ID found.");
                    return;
                }
                if (cancelButton.classList.contains('disabled')) {
                    showAlert('This order cannot be cancelled as it has already been shipped, delivered, or previously cancelled.', 'warning');
                    return;
                }
                openCancelModal(orderId);
            }
        });
    }

    // --- View Modal close listeners ---
    if (closeBtn) closeBtn.addEventListener('click', closeOrderModal);
    if (modal) {
        modal.addEventListener('click', (e) => {
            if (e.target === modal) closeOrderModal();
        });
    }

    // --- Filter Event Listeners ---
    if (searchInput) searchInput.addEventListener('input', filterAndRenderOrders);

    // --- Initialize Libraries ---
    // 1. Initialize flatpickr
    if (dateFromInput && dateToInput) {
        flatpickr(dateFromInput, { dateFormat: "Y-m-d", onChange: function (selectedDates, dateStr, instance) { filterAndRenderOrders(); } });
        flatpickr(dateToInput, { dateFormat: "Y-m-d", onChange: function (selectedDates, dateStr, instance) { filterAndRenderOrders(); } });
    }
    // 2. Initialize Choices.js for Filters
    if (orderStatusFilter) {
        orderStatusChoiceInstance = new Choices(orderStatusFilter, { searchEnabled: false, itemSelectText: '', shouldSort: false, allowHTML: false });
        orderStatusFilter.addEventListener('change', filterAndRenderOrders, false);
    }
    if (paymentStatusFilter) {
        paymentStatusChoiceInstance = new Choices(paymentStatusFilter, { searchEnabled: false, itemSelectText: '', shouldSort: false, allowHTML: false });
        paymentStatusFilter.addEventListener('change', filterAndRenderOrders, false);
    }
    // 3. Initialize Choices.js for Modal Dropdown
    if (modalUpdateStatusSelect) {
        modalStatusChoiceInstance = new Choices(modalUpdateStatusSelect, { searchEnabled: false, itemSelectText: '', shouldSort: false, allowHTML: false });

        // Listener for status change to toggle tracking code input
        modalUpdateStatusSelect.addEventListener('change', (e) => {
            const status = modalStatusChoiceInstance ? modalStatusChoiceInstance.getValue(true) : e.target.value;
            const trackingGroup = document.getElementById('trackingCodeGroup');
            if (trackingGroup) {
                if (status === 'shipped') {
                    trackingGroup.style.display = 'flex';
                } else {
                    trackingGroup.style.display = 'none';
                }
            }

            if (status === 'returned') {
                const orderData = ordersData.find(o => o.id === currentOrderId);
                if (orderData) {
                    const orderIdToUpdate = orderData.dbOrderId || orderData.id;
                    const oldStatus = orderData.orderStatus || 'pending';

                    const params = {
                        source: 'modal',
                        orderId: currentOrderId,
                        dbOrderId: orderIdToUpdate,
                        oldStatus: oldStatus,
                        orderData: orderData
                    };
                    openReturnModal(orderIdToUpdate, currentOrderId, params);
                }
            }
        });
    }

    // --- Initial Load ---
    loadOrdersFromAPI(); // Load orders from Django API on page load

    // --- Add View Modal Button Listeners ---
    if (modalUpdateBtn) {
        modalUpdateBtn.addEventListener('click', async () => {
            if (!currentOrderId) return;

            let newStatus;
            if (modalStatusChoiceInstance) {
                newStatus = modalStatusChoiceInstance.getValue(true);
            } else if (modalUpdateStatusSelect) {
                newStatus = modalUpdateStatusSelect.value;
            }

            if (!newStatus) {
                console.error("No status selected in modal dropdown.");
                return;
            }

            // Find the order to get database ID
            const orderIndex = ordersData.findIndex(o => o.id === currentOrderId);
            if (orderIndex === -1) {
                console.error(`Could not find order ${currentOrderId} to update status.`);
                showAlert('Order not found. Please refresh the page.', 'error');
                return;
            }

            const order = ordersData[orderIndex];
            const orderIdToUpdate = order.dbOrderId || order.id; // Use database ID if available, otherwise use order ID

            // --- STRICT FLOW ENFORCEMENT ---
            // Only allow "Fulfilled" if currently "Delivered"
            if (newStatus === 'fulfilled') {
                const currentStatus = order.orderStatus || 'pending';
                if (currentStatus !== 'delivered') {
                    showAlert('⚠️ Order can only be marked as "Fulfilled" after it is "Delivered".', 'warning');
                    return;
                }
            }

            // Disable button during update
            modalUpdateBtn.disabled = true;
            modalUpdateBtn.textContent = 'Updating...';

            try {
                // Call API to update order
                const trackingInput = document.getElementById('modalTrackingCode');
                const trackingCode = trackingInput ? trackingInput.value : '';

                if (newStatus === 'shipped' && !trackingCode.trim()) {
                    showAlert('Please enter a tracking code for shipped orders.', 'warning');
                    modalUpdateBtn.disabled = false;
                    modalUpdateBtn.textContent = 'Update';
                    return;
                }

                const response = await fetch('/admin/api/orders/update/', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                        'X-CSRFToken': getCookie('csrftoken')
                    },
                    body: JSON.stringify({
                        order_id: orderIdToUpdate,
                        status: newStatus,
                        tracking_code: trackingCode
                    })
                });

                const result = await response.json();

                if (response.ok && result.success) {
                    console.log(`Order ${currentOrderId} status updated to ${newStatus}`);

                    // Update local data
                    ordersData[orderIndex].orderStatus = newStatus;
                    ordersData[orderIndex].status = newStatus;

                    // Update tracking info locally if available in response
                    if (result.order && result.order.tracking_code) {
                        // Update nested delivery object
                        if (!ordersData[orderIndex].delivery) ordersData[orderIndex].delivery = {};
                        ordersData[orderIndex].delivery.tracking = result.order.tracking_code;
                        // Update flat field if used
                        ordersData[orderIndex].tracking_number = result.order.tracking_code;
                    }

                    // Reload orders from API to ensure consistency
                    await loadOrdersFromAPI();

                    // Update UI
                    filterAndRenderOrders();
                    closeOrderModal();

                    // Show success message
                    alert(`Order status updated to ${newStatus}`);
                } else {
                    console.error('Failed to update order:', result.message || 'Unknown error');
                    alert(`Failed to update order: ${result.message || 'Unknown error'}`);

                    // Re-enable button
                    modalUpdateBtn.disabled = false;
                    modalUpdateBtn.textContent = 'Update';
                }
            } catch (error) {
                console.error('Error updating order:', error);
                alert(`Error updating order: ${error.message}`);

                // Re-enable button
                modalUpdateBtn.disabled = false;
                modalUpdateBtn.textContent = 'Update';
            }
        });
    }

    // --- START: CORRECTED Print Button Listener (Uses jsPDF & AutoTable) ---
    if (modalPrintBtn) {
        modalPrintBtn.addEventListener('click', () => {
            // 1. Re-check if libraries are loaded (important!)
            if (typeof jsPDF === 'undefined' || typeof autoTable === 'undefined') {
                alert('PDF generation library (jsPDF/AutoTable) is not loaded correctly. Cannot create PDF.');
                console.error("jsPDF or jsPDF AutoTable is not defined inside click handler.");
                return; // Stop if libraries are missing
            }

            if (!currentOrderId) {
                alert('No order selected.');
                return;
            }
            const order = ordersData.find(o => o.id === currentOrderId);
            if (!order) {
                alert('Order data not found.');
                return;
            }

            // --- *** LOGGING STARTS HERE *** ---
            console.log("--- Generating PDF for Order:", currentOrderId, "---");
            console.log("Order Data:", order);

            try {
                // --- !!! PASTE YOUR BASE64 LOGO STRING HERE !!! ---
                const logoBase64 = 'data:image/png;base64,';
                // Example: const logoBase64 = 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAA...';

                // --- Log the Base64 string (or placeholder) ---
                if (logoBase64 === 'data:image/png;base64,') {
                    console.warn("Logo Base64 string is still the placeholder!");
                } else if (!logoBase64 || typeof logoBase64 !== 'string' || !logoBase64.startsWith('data:image')) {
                    console.error("Invalid or missing Base64 string detected:", logoBase64);
                } else {
                    console.log("Base64 string found (length):", logoBase64.length); // Log length to check if it's substantial
                }

                // --- PDF Setup ---
                const doc = new jsPDF(); // Use the constructor directly
                const pageMargin = 15;
                const pageWidth = doc.internal.pageSize.getWidth();
                const usableWidth = pageWidth - 2 * pageMargin;
                let yPos = pageMargin; // Start Y position
                const sectionSpacing = 8; // Space between sections

                // --- Header ---
                console.log("Attempting to add header/logo...");
                if (logoBase64 && logoBase64 !== 'PASTE_YOUR_BASE64_LOGO_STRING_HERE' && logoBase64.startsWith('data:image')) {
                    try {
                        // Simplify image adding for debugging: Use fixed dimensions
                        const imgWidth = 30;
                        const imgHeight = 15;
                        console.log("Calling doc.addImage with Base64...");
                        doc.addImage(logoBase64, 'PNG', pageMargin, yPos, imgWidth, imgHeight); // Use 'PNG' or 'JPEG' based on your Base64 prefix
                        console.log("doc.addImage called successfully.");
                        yPos += imgHeight + 5; // Move down below logo + spacing

                    } catch (imgError) {
                        console.error("!!! Error during doc.addImage:", imgError); // Log specific image error
                        // Add placeholder text if logo fails
                        doc.setFontSize(10);
                        doc.text("Logo Error (See Console)", pageMargin, yPos + 7);
                        yPos += 15;
                    }
                } else {
                    console.log("Using placeholder company name instead of logo.");
                    doc.setFontSize(10);
                    doc.text("Your Company Name", pageMargin, yPos + 7); // Placeholder if no logo
                    yPos += 15;
                }
                console.log("Header/Logo section complete. Current yPos:", yPos);

                doc.setFontSize(18);
                doc.setFont(undefined, 'bold');
                doc.text('INVOICE', pageWidth - pageMargin, pageMargin + 7, { align: 'right' });

                // --- Order Info (below logo/company name) ---
                doc.setFontSize(10);
                doc.setFont(undefined, 'normal');
                const orderInfoY = pageMargin + 15;
                doc.text(`Order ID: ${order.id || 'N/A'}`, pageWidth - pageMargin, orderInfoY, { align: 'right' });
                doc.text(`Date: ${order.date || 'N/A'}`, pageWidth - pageMargin, orderInfoY + 5, { align: 'right' });
                doc.text(`Status: ${order.orderStatus?.toUpperCase() || 'N/A'}`, pageWidth - pageMargin, orderInfoY + 10, { align: 'right' });

                yPos = Math.max(yPos, orderInfoY + 15);
                console.log("Order Info section complete. Current yPos:", yPos);

                // --- Addresses ---
                const addressStartY = yPos;
                const col1X = pageMargin;
                const col2X = pageMargin + usableWidth / 2 + 5;
                const addressMaxWidth = usableWidth / 2 - 10;

                doc.setFontSize(11);
                doc.setFont(undefined, 'bold');
                doc.text('Bill To:', col1X, yPos);
                doc.text('Ship To:', col2X, yPos);
                yPos += 6;

                doc.setFontSize(10);
                doc.setFont(undefined, 'normal');
                const billingLines = doc.splitTextToSize(
                    `${order.customer?.name || ''}\n${(order.customer?.billingAddress || 'N/A').replace(/\\n/g, '\n')}`,
                    addressMaxWidth
                );
                const shippingLines = doc.splitTextToSize(
                    `${order.customer?.name || ''}\n${(order.customer?.shippingAddress || 'N/A').replace(/\\n/g, '\n')}`,
                    addressMaxWidth
                );

                const maxLines = Math.max(billingLines.length, shippingLines.length);
                let currentAddressY = yPos;
                for (let i = 0; i < maxLines; i++) {
                    if (currentAddressY > 275) {
                        doc.addPage();
                        currentAddressY = pageMargin;
                    }
                    doc.text(billingLines[i] || '', col1X, currentAddressY);
                    doc.text(shippingLines[i] || '', col2X, currentAddressY);
                    currentAddressY += 5;
                }
                yPos = currentAddressY + sectionSpacing;
                console.log("Addresses section complete. Current yPos:", yPos);

                // --- Items Table ---
                const tableHeaders = [['SKU', 'Product Name', 'Qty', 'Unit Price', 'Total']];
                const tableBody = (order.items || []).map(item => {
                    const price = item.price || 0;
                    const qty = item.qty || 0;
                    return [
                        item.sku || 'N/A',
                        item.name || 'N/A',
                        qty,
                        `$${price.toFixed(2)}`,
                        `$${(qty * price).toFixed(2)}`
                    ];
                });

                if (yPos > 260) {
                    doc.addPage();
                    yPos = pageMargin;
                } else {
                    yPos += 5;
                }
                console.log("Attempting to add AutoTable...");
                // Use the autoTable function correctly
                doc.autoTable({ // Call autoTable on the doc instance
                    head: tableHeaders,
                    body: tableBody,
                    startY: yPos,
                    theme: 'grid',
                    headStyles: { fillColor: [156, 39, 176], textColor: 255 },
                    styles: { fontSize: 9, cellPadding: 2, overflow: 'linebreak' },
                    columnStyles: {
                        0: { cellWidth: 30 },
                        1: { cellWidth: 'auto' },
                        2: { cellWidth: 15, halign: 'right' },
                        3: { cellWidth: 25, halign: 'right' },
                        4: { cellWidth: 25, halign: 'right' }
                    },
                    didDrawPage: (data) => {
                        yPos = data.cursor.y + sectionSpacing;
                        console.log("AutoTable drew page, new yPos:", yPos);
                    },
                    margin: { top: pageMargin, right: pageMargin, bottom: pageMargin, left: pageMargin }
                });
                console.log("AutoTable added. Current yPos:", yPos);


                // --- Totals Section ---
                if (yPos > 240) {
                    doc.addPage();
                    yPos = pageMargin;
                }
                const totalsX = pageWidth - pageMargin;
                const totalsLabelX = totalsX - 40;
                doc.setFontSize(10);
                doc.setFont(undefined, 'normal');

                doc.text(`Subtotal:`, totalsLabelX, yPos);
                doc.text(`$${order.payment?.subtotal?.toFixed(2) || '0.00'}`, totalsX, yPos, { align: 'right' });
                yPos += 6;
                doc.text(`Discount:`, totalsLabelX, yPos);
                doc.text(`-$${order.payment?.discount?.toFixed(2) || '0.00'}`, totalsX, yPos, { align: 'right' });
                yPos += 6;
                doc.text(`Tax:`, totalsLabelX, yPos);
                doc.text(`$${order.payment?.tax?.toFixed(2) || '0.00'}`, totalsX, yPos, { align: 'right' });
                yPos += 6;
                doc.text(`Shipping:`, totalsLabelX, yPos);
                doc.text(`$${order.payment?.shipping?.toFixed(2) || '0.00'}`, totalsX, yPos, { align: 'right' });
                yPos += 4;
                doc.setLineWidth(0.3);
                doc.line(totalsLabelX - 5, yPos, totalsX, yPos);
                yPos += 6;

                doc.setFontSize(12);
                doc.setFont(undefined, 'bold');
                doc.text(`Total:`, totalsLabelX, yPos);
                doc.text(`$${order.payment?.total?.toFixed(2) || '0.00'}`, totalsX, yPos, { align: 'right' });
                yPos += sectionSpacing * 1.5;
                console.log("Totals section complete. Current yPos:", yPos);

                // --- Payment Info ---
                doc.setFontSize(10);
                doc.setFont(undefined, 'normal');
                if (yPos > 260) { doc.addPage(); yPos = pageMargin; }
                doc.text(`Payment Method: ${order.payment?.method || 'N/A'}`, pageMargin, yPos);
                doc.text(`Payment Status: ${order.payment?.status?.toUpperCase() || 'N/A'}`, pageMargin, yPos + 5);
                if (order.payment?.transactionId) {
                    doc.text(`Transaction ID: ${order.payment.transactionId}`, pageMargin, yPos + 10);
                    yPos += 5;
                }
                yPos += 15;
                console.log("Payment Info section complete. Current yPos:", yPos);

                // --- Footer ---
                const finalPageNum = doc.internal.getNumberOfPages();
                doc.setPage(finalPageNum);
                const bottomY = doc.internal.pageSize.getHeight() - 15;

                if (yPos > bottomY - 10) {
                    doc.addPage();
                    // Redraw footer on new page
                    doc.setFontSize(9);
                    doc.setTextColor(150);
                    doc.text('Thank you for your business!', pageWidth / 2, bottomY, { align: 'center' });
                    doc.text(`Page ${doc.internal.getNumberOfPages()}`, pageWidth - pageMargin, bottomY, { align: 'right' });
                } else {
                    // Draw footer on current last page
                    doc.setFontSize(9);
                    doc.setTextColor(150);
                    doc.text('Thank you for your business!', pageWidth / 2, bottomY, { align: 'center' });
                    doc.text(`Page ${finalPageNum}`, pageWidth - pageMargin, bottomY, { align: 'right' });
                }
                console.log("Footer added.");

                // --- Trigger Download ---
                const filename = `invoice-${order.id.replace('#', '')}.pdf`;
                console.log("Calling doc.save()...");
                doc.save(filename); // This should trigger the PDF download
                console.log("doc.save() called.");

            } catch (error) {
                console.error("!!! Error generating PDF:", error); // Log the specific error
                alert("An error occurred while generating the PDF invoice. Check the console for details."); // Keep alert but also log
            }
        });
    }
    // --- END: CORRECTED Print Button Listener ---

    // --- Add Cancel Modal Button Listeners ---
    if (confirmCancelBtn) {
        confirmCancelBtn.addEventListener('click', () => {
            if (orderIdToCancel) {
                const orderIndex = ordersData.findIndex(o => o.id === orderIdToCancel);
                if (orderIndex !== -1) {
                    // Check status again before cancelling
                    const currentStatus = ordersData[orderIndex].orderStatus;
                    if (currentStatus === 'processing' || currentStatus === 'pending') {
                        ordersData[orderIndex].orderStatus = 'cancelled';
                        console.log(`Order ${orderIdToCancel} cancelled.`);
                        filterAndRenderOrders();
                    } else {
                        alert(`Order status is now ${currentStatus}. Cannot cancel.`);
                    }
                } else {
                    console.error(`Could not find order ${orderIdToCancel} to cancel.`);
                }
                closeCancelModal();
            }
        });
    }
    if (cancelActionBtn) cancelActionBtn.addEventListener('click', closeCancelModal);
    if (cancelModalCloseBtn) cancelModalCloseBtn.addEventListener('click', closeCancelModal);
    if (cancelModal) {
        cancelModal.addEventListener('click', (e) => {
            if (e.target === cancelModal) {
                closeCancelModal();
            }
        });
    }


});